TITLE:
  - "A block under compression with an embedded mesh configuration. The interface is made"
  - "by nurbs9 elements. The interface cuts a background mesh"
  - "made by wedge6 and hex8 elements."
PROBLEM TYPE:
  PROBLEMTYPE: "Structure"
  SHAPEFCT: "Nurbs"
IO/RUNTIME VTK OUTPUT:
  INTERVAL_STEPS: 1
  OUTPUT_DATA_FORMAT: ascii
IO/RUNTIME VTK OUTPUT/STRUCTURE:
  OUTPUT_STRUCTURE: true
  DISPLACEMENT: true
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "Statics"
  TIMESTEP: 0.1
  NUMSTEP: 1
  MAXTIME: 1
  M_DAMP: 1e-05
  K_DAMP: 1e-05
  TOLDISP: 1e-06
  MAXITER: 30
  LINEAR_SOLVER: 1
SOLVER 1:
  SOLVER: "Superlu"
  NAME: "Struct_Solver"
SOLVER 2:
  SOLVER: "Superlu"
  NAME: "Contact_Solver"
CONTACT DYNAMIC:
  LINEAR_SOLVER: 2
MORTAR COUPLING:
  SEARCH_PARAM: 0.1
  LM_QUAD: "quad"
  TRIANGULATION: "Center"
CUT GENERAL:
  GENERAL_POSITION_DISTANCE_FLOATTYPE: "double"
  GENERAL_POSITION_POSITION_FLOATTYPE: "double"
  DO_SELFCUT: false
  BOUNDARYCELL_CUBATURDEGREE: 1
  INTEGRATE_INSIDE_CELLS: false
EMBEDDED MESH COUPLING:
  COUPLING_STRATEGY: mortar
  MORTAR_SHAPE_FUNCTION: nurbs9
  CONSTRAINT_ENFORCEMENT: penalty
  CONSTRAINT_ENFORCEMENT_PENALTYPARAM: 1000
